package syntaxtree;import visitor.InterpreterVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class False extends Exp {	public False(Position p){		position=p;	}  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }    public Boolean accept(InterpreterVisitor v) {	  return v.visit(this);  }}